package com.example.demo.excecao;

public class Erro {
	
	private String msg;
	private String msgDev;
	
	public Erro() {
		// TODO Auto-generated constructor stub
	}

	public Erro(String msg, String msgDev) {
		this.msg = msg;
		this.msgDev = msgDev;
	}

	public String getMsg() {
		return msg;
	}

	public void setMsg(String msg) {
		this.msg = msg;
	}

	public String getMsgDev() {
		return msgDev;
	}

	public void setMsgDev(String msgDev) {
		this.msgDev = msgDev;
	}
	
	
	

}
